import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>dakota</h1>
      <ul>
        <li>happy  luqman</li>
        <li>cute shahan</li>
        <li>motivated  haneen</li>
        <li>apple watch faiz</li>
        <li>nattil pok favas</li>
        <li>strict hisham</li>
        <li>nan thanne jaseem</li>
      </ul>
    </div>
  );
}

export default App;
